import React from "react";
import { Image } from "semantic-ui-react";
import dad from "../../../avatar/dad.png";

const MEMBERS = [
  {
    src : dad,
    name : 'Lucas Sett'
  },
  {
    src : dad,
    name : 'Lucas Sett'
  },
  {
    src : dad,
    name : 'Lucas Sett'
  },
  {
    src : dad,
    name : 'Lucas Sett'
  },
  {
    src : dad,
    name : 'Lucas Sett'
  }

]
const Member = () => {
  return (
    <div className="chat-container member border">
      <div className="member-item">
        <Image src={dad} size="mini" circular className="center" />
        <div>Lucas Sett</div>
      </div>
      {MEMBERS.map(({avatar,name}) => {
        return <div className="member-item">
          <Image src={avatar} size="mini" circular className="center" />
          <div>{name}</div>
      </div>
      })}
    </div>
  );
};

export default Member;
